<?phpnamespace Nemundo\Meteo\Meteocentrale\Data\Foehndiagramm;class FoehndiagrammPaginationReader extends \Nemundo\Model\Reader\AbstractPaginationModelDataReader {/*** @var FoehndiagrammModel*/public $model;public function __construct() {parent::__construct();$this->model = new FoehndiagrammModel();}/*** @return FoehndiagrammRow[]*/public function getData() {$list = [];foreach (parent::getData() as $dataRow) {$row = new FoehndiagrammRow($dataRow, $this->model);$list[] = $row;}return $list;}}